demo.repl.help:
Tlanahuatilmeh in hueli:
  @show              ─ nextilia in tlamachtiliztli tlen card adaptive sa ocachi yancuic
  @json              ─ quichiua ma quisa in melahuac JSON tlen mocelihua ipan flow
  @back              ─ mocuepa campa achto omotzacuili card/inputs
  @input <k>=<v>     ─ quitalia noso quipatla se campo de entrada
  @click <action_id> ─ quintitlania in card ica in acción tlen omomaca
  @help              ─ quipoua ni tlapalhuiliztlahtolli
  @quit              ─ quisa ipan REPL
